import React from 'react'
import './Tile.css' 
export default function Tile(props) {
    var tiles = []
    var counter = 0;
    props.tileArr.forEach(element => {
        tiles.push([])
        element.forEach(letter => {
            if(letter){
                tiles[counter].push(<div className='singleTile'>{letter}</div>)
            } else {
                tiles[counter].push(<div className='empty'></div>)
            }
        })
        counter++;
    });
    console.log(tiles)

  return (
    <>
    <div>{tiles.map((row)=>(
        <div className='row'>
        {row.map((letter)=>(
            <div>{letter}</div>
        ))}
        </div>
    ))}</div>
    {/* <div className='wholePiece'>{tiles}</div> */}
    </>
  )
}
